return ['domain'=>NULL,'plural-forms'=>'nplurals=1; plural=0;','language'=>'ja_JP','pot-creation-date'=>'2025-06-09 11:26-0700','po-revision-date'=>'2025-06-09 11:29-0700','translation-revision-date'=>'2025-06-09 11:29-0700','project-id-version'=>'Print My Blog','x-generator'=>'Poedit 3.6','messages'=>['Purpose'=>'用途','Similar to Print My Blog Quick Print and dotEpub, but supporting Pro features. Great for printing your WordPress content as an eBook for reading from a tablet or phone, or uploading to eBook marketplaces like Amazon or Apple Book Store.'=>'Print My Blog Quick Print や dotEpub に似ていますが、Pro 機能をサポートしています。WordPressのコンテンツをタブレットや携帯電話から読んだり、AmazonやApple Book Storeなどの電子書籍マーケットプレイスにアップロードしたりするための電子書籍として印刷するのに最適です。','A table of contents is generated and inserted into the book (no need to add it using an external service like Kindle Direct Publishing or Calibre).'=>'目次が生成され、ブックに挿入されます (Kindle Direct Publishing や Calibre などの外部サービスを使用して追加する必要はありません)。','Images are bundled into the book file so they can be used offline.'=>'画像はオフラインで使用ため、ブックファイルにバンドルされています。','Image galleries are rearranged into a simple list of images which displays better on smaller devices.'=>'画像ギャラリーは、小さなデバイスでよりよく表示される画像の単純なリストに再配置されます。','If there are any features or options you want, %1$splease get in touch.%2$s'=>'ご希望の機能やオプションがある場合は、%1$sお問い合わせください。%2$s','Features'=>'特徴','Supports nesting articles (like posts and pages) into “parts”'=>'記事(投稿やページなど)を「パーツ」にネストすることをサポート','External hyperlinks (links to web pages not in the project) are left as working hyperlinks'=>'外部ハイパーリンク(プロジェクト内にないウェブページへのリンク)は、自動的に脚注に変換したり、削除したりできます','Internal hyperlinks (links to content included in the project) are converted into links to the appropriate page of the eBook'=>'内部ハイパーリンク(プロジェクトコンテンツへのリンク)は、自動的に脚注かインラインページ参照に変換したり、削除できます','The default title page can include: Project Title, Subtitle, Site URL, Date Printed, Credit to Print My Blog'=>'デフォルトのタイトルページには、プロジェクトタイトル、字幕、サイトURL、印刷日、マイブログを印刷するためのクレジットを含めることができます','Each article can include: Title, ID, Author, URL, Date Published, Categories and Tags, Featured Image, Excerpt, Custom Fields, Content'=>'各記事に含めることができます:タイトル、ID、著者、URL、公開日、カテゴリとタグ、アイキャッチ画像、抜粋、カスタムフィールド、コンテンツ','All images are automatically included in the ePub file (instead of merely pointing to the external image source). This makes the filesize larger, but allows users to view images while disconnected from the Internet.'=>'すべての画像は、(単に外部画像ソースを指すのではなく)ePubファイルに自動的に含まれます。これにより、ファイルサイズは大きくなりますが、ユーザーはインターネットから切断されているときに画像を表示できます。','Small images are automatically centered'=>'オプションで画像を自動的に中央揃えにする','Image galleries are converted into regular list of images, which look better on small screens.'=>'画像ギャラリーは、小さなデバイスでよりよく表示される画像の単純なリストに再配置されます。','Page Layout'=>'ページレイアウト','The page design is mostly dictated by the app and device used for reading'=>'ページのデザインは、主に読書に使用されるアプリとデバイスによって決まります','Each article begins on a new page.'=>'各記事は新しいページから始まります','ID:%s'=>'ID：%s','By %s'=>'%s による','Powered by WordPress & Print My Blog'=>'ワードプレス＆私のブログ印刷する','comments title' . "\4" . 'One Reply to &ldquo;%s&rdquo;'=>'&ldquo;%s&rdquo; への1件の返信;','comments title' . "\4" . '%1$s Reply to &ldquo;%2$s&rdquo;'=>'%1$s 返信 &ldquo;%2$s&rdquo;','Printed on %1$s'=>'%1$sに印刷しました','Designed for a school, company, or organization that wants to include their name, logo, and colors throughout the PDF. Because of its exstensive use of colors, it’s usually best viewed from a computer or handheld device.'=>'学校、会社、または組織で、名前、ロゴ、および色を PDF 全体に含める必要がある場合に設計されています。色が広範囲に使用されているため、通常はコンピューターまたはハンドヘルド デバイスから見るのが最適です。','Easier content editing because there are no nesting parts.'=>'コンテンツ編集が容易ようにネスト部分がありません。','All hyperlinks converted into footnotes'=>'ハイパーリンクはすべて脚注に変換されます。','The title page can include your organization’s name, project title, issue number, list of authors, and an introductory paragraph.'=>'タイトル ページには、組織の名前、プロジェクトのタイトル、刊行番号、作成者の一覧、および導入段落を含めることができます。','Each article includes just its title and content'=>'各記事には、タイトルと内容のみが含まれています。','The default title page includes a stylized banner (with customizable color) above a colored background featuring a large version of your company logo.'=>'既定のタイトル ページには、色付きの背景の上に様式バナー (カスタマイズ可能な色) があり、会社のロゴの大きなバージョンが特徴です。','Main matter pages fade from white to a color of your choosing in the corner where your logo and page number are shown.'=>'メインマターページは、ロゴとページ番号が表示されるコーナーで、白から選択した色にフェードします。','Page numbers in bottom-right corner, and article titles in the top-right. Front-matter’s pages are numbered with Roman numerals'=>'右下隅にページ番号、右上に記事のタイトル。フロントマターのページにはローマ数字の番号が付けられています','Each article begins on a new page'=>'各記事は新しいページから始まります','Back matter uses your large company logo with background color'=>'バックマターは、背景色で大企業のロゴを使用しています','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for making a PDF for an easy-to-read digital backup of your favorite website content.'=>'私のブログクイックプリントを印刷するのと非常によく似ていますが、Pro機能をサポートしています。お気に入りのウェブサイトコンテンツの読みやすいデジタルバックアップ用のPDFを作成するのに最適です。','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes, left in-place, or removed'=>'外部ハイパーリンク (プロジェクト内にない Web ページへのリンク) は、自動的に脚注に変換したり、そのままにしたり、削除したりできます','Footnotes only work with Pro'=>'脚注はProでのみ機能します','Internal hyperlinks (links to content included in the project) can be automatically converted to to footnotes, inline page references, left in-place, or removed'=>'内部ハイパーリンク(プロジェクトコンテンツへのリンク)は、自動的に脚注かインラインページ参照に変換したり、そのままにしたり、削除できます','Footnotes and page references only work with Pro PDF Service'=>'脚注とページ参照は、Pro PDF サービスでのみ機能します','Limit image size by setting maximum height'=>'最大高さを設定して画像サイズを制限する','Optionally automatically center images'=>'オプションで画像を自動的に中央揃えにする','Optionally float images to the top or bottom of each page'=>'オプションで、画像を各ページの上部または下部にフロートする','Page numbers in bottom-right corner, article titles in the top-right, and part titles (if using parts) appear in the top-left corner. Front-matter’s pages are numbered with Roman numerals'=>'右下隅にページ番号、右上に記事タイトル、およびパーツタイトル(パーツを使用している場合)が左上隅に表示されます。フロントマターのページにはローマ数字の番号が付けられています','Most browsers add their own content to the page margins'=>'ほとんどのブラウザは、ページ余白に独自のコンテンツを追加します','Each article can optionally begin on a new page'=>'各記事は、必要に応じて新しいページから開始できます','Designed to look good when viewed from a device or printing to paper. The two-column layout leads to more compact content, especially good if your content doesn’t require the full page width'=>'デバイスから見たり、紙に印刷したりしたときに見栄えが良いように設計されています。2列のレイアウトは、コンテンツがよりコンパクトになり、コンテンツがページ幅全体を必要としない場合に特に適しています','Most browsers will only print a white background'=>'ほとんどのブラウザは白い背景のみを印刷します','Main matter is divided into two columns, while front matter uses the full page width.'=>'メインマターは2つの列に分かれていますが、フロントマターはページ幅全体を使用します。','Some browsers don‘t support multiple columns'=>'一部のブラウザーは複数の列をサポートしていません','Content can be divided into parts with a special part opening area using the full page width.'=>'コンテンツは、全ページ幅を使用して、特別な部分開口部領域を持つ部分に分割することができます。','The title page can include a title and preamble. Other content can immediately follow, without needing a page break.'=>'タイトル ページには、タイトルとプリアンブルを含めることができます。他のコンテンツは、改ページを必要とせずに、すぐに続くことができます。','Each article includes just its title and content, and an optional dividing line to help distinguish between articles.'=>'各記事には、タイトルと内容のみが含まれ、記事を区別するのに役立つオプションの分割線が含まれています。','If your content is already divided into columns, optionally automatically remove them to improve the layout.'=>'コンテンツが既に列に分割されている場合は、必要に応じて自動的に削除してレイアウトを改善します。','Optionally begin each post on a new page, or be shown immediately following the previous one.'=>'必要に応じて、各投稿を新しいページで開始するか、前のページの直後に表示します。','Optionally have each article title take up the full page width, or show them inside columns.'=>'必要に応じて、各記事のタイトルをページ幅全体にするか、列内に表示します。','Internal links (hyperlinks to content included in the project) are replaced with page references.'=>'内部リンク (プロジェクトに含まれるコンテンツへのハイパーリンク) は、ページ参照に置き換えられます。','External links (hyperlinks to content on the internet) are left as-is.'=>'外部リンク(インターネット上のコンテンツへのハイパーリンク)はそのまま残されます。','Most content is divided between two columns.'=>'ほとんどのコンテンツは 2 つの列に分割されます。','Page numbers in bottom-right corner, and part titles in the top-left. Front-matter’s pages are numbered with Roman numerals'=>'右下隅にページ番号、左上にパーツ タイトルがあります。フロントマターのページにはローマ数字の番号が付けられています','Special Instructions'=>'特別な指示','Front matter defaults to using the full page width. To force something to be divided into columns, add the CSS class "mayer-columns" inside your content.'=>'フロントマターはデフォルトでページ幅全体を使用します。何かを強制的に列に分割するには、コンテンツ内にCSSクラス "mayer-columns"を追加します。','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for printing your WordPress content.'=>'私のブログクイックプリントを印刷するのと非常によく似ていますが、Pro機能をサポートしています。あなたのワードプレスのコンテンツを印刷するのに最適です。','For creating a printout of your WordPress content that saves paper and ink.'=>'紙とインクを節約するWordPressコンテンツのプリントアウトを作成するため。','This design uses a smaller font, small images, doesn’t add pagebreaks between articles, and avoids unnecessary extra information.'=>'このデザインは、小さなフォントと小さな画像を使用し、記事間に改ページを追加せず、不要な追加情報を回避します。','Perfect for editing and reviewing your content! Compact to conserve paper, lots of meta-information, and double-spaced text to allow for editor’s notes.'=>'コンテンツの編集やレビューに最適です!コンパクトで、紙、多くのメタ情報、および編集者のメモを可能にするダブルスペースのテキストを節約します。','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes or removed'=>'外部ハイパーリンク(プロジェクト内にないウェブページへのリンク)は、自動的に脚注に変換したり、削除したりできます','Footnotes require Pro'=>'脚注にはプロが必要','Internal hyperlinks (links to content included in the project) can be automatically converted to footnotes, inline page references, or removed'=>'内部ハイパーリンク(プロジェクトコンテンツへのリンク)は、自動的に脚注かインラインページ参照に変換したり、削除できます','Footnotes and page references require Pro PDF Service'=>'脚注とページ参照にはPro PDFサービスが必要です','This design is meant for printing on both sides of the page so you see two pages at once (the "page spread"). So the left-hand page will be styled differently than the right-hand page.'=>'このデザインは、ページの両面に印刷するためのもので、一度に2つのページ(「見開きページ」)が表示されます。したがって、左側のページは右側のページとは異なるスタイルになります。','Page numbers in bottom-outside corner, part titles appear in the top of the left page, article titles appear at the top of the right page. Front-matter’s pages are numbered with Roman numerals'=>'ページ番号は外側下隅に、部品タイトルは左ページの上部に、記事タイトルは右ページの上部に表示されます。フロントマターのページにはローマ数字の番号が付けられています','Multi-column newspaper design designed for printing. Wide images can span multiple columns and always snap to the nearest page edge to make a visually-appealing layout.'=>'印刷用に設計された複数列の新聞デザイン。幅の広い画像は複数の列にまたがることができ、常に最も近いページの端にスナップして、視覚的に魅力的なレイアウトを作成できます。','The "Title page" is actually a special header on the front page containing your publication\'s title, issue number, date, and other optional prominent info (set on the design and project meta settings).'=>'「タイトルページ」は、実際には、出版物のタイトル、号番号、日付、およびその他のオプションの目立つ情報(デザインとプロジェクトのメタ設定で設定)を含むフロントページの特別なヘッダーです。','Content is divided into two, three, or four columns.'=>'ほとんどのコンテンツは 2 つの列に分割されます。','The top margin contains the front page (publication title, issue number, date, etc.).'=>'上部の余白には、フロントページ(出版物のタイトル、号番号、日付など)が含まれています。','Designed for duplex printing with the left page mirroring the right page\'s margins.'=>'左ページが右ページの余白を反映した両面印刷用に設計されています。','Content can be divided into parts. Part openings and important articles\' titles and cover images take up the full page width, whereas regular articles compactly fit into columns.'=>'コンテンツは部分に分けることができます。パートの冒頭や重要な記事のタイトルや表紙の画像はページ幅全体を占めますが、通常の記事は列にコンパクトに収まります。','Each article may include post title, ID, author, published date, categories and tags, URL, featured image, excerpt, custom fields, and content.'=>'各記事に含めることができます:タイトル、ID、著者、URL、公開日、カテゴリとタグ、アイキャッチ画像、抜粋、カスタムフィールド、コンテンツ','Issue and page number are in the outside top margin, the publication\'s title is in the middle top margin, and the publication date is in the inside top margin. The optional publication subtitle is underneath the other top-margin content.'=>'号とページ番号は外側の上余白、出版物のタイトルは中央の上余白、発行日は内側の上余白にあります。オプションのパブリケーションサブタイトルは、他の上余白コンテンツの下にあります。','Section Templates'=>'デフォルトテンプレート','Choose different styles for articles included in your project:'=>'プロジェクトに含まれる記事に異なるスタイルを選択します。','Default Template: shows all content specified by the "Post Content" design setting (e.g. the article\'s title and featured image) in columns.'=>'デフォルトテンプレート:「投稿コンテンツ」デザイン設定で指定されたすべてのコンテンツ(記事のタイトルやアイキャッチ画像など)を列に表示します。','Single Column: like the default template, but in a single column.'=>'単一列:「コンテンツの投稿」デザイン設定で指定されたすべてのコンテンツを1列に表示します。','Fullpage Content: contains only the article\'s content (no title, featured image, etc.) all in a single, wide column.'=>'フルページコンテンツ:記事のコンテンツ(タイトル、アイキャッチ画像などなし)のみが1つの幅の広い列に含まれます。','Full Column Content: like "Fullpage Content", except content is still divided into multiple columns..'=>'フルコラムコンテンツ:「フルページコンテンツ」と似ていますが、コンテンツが複数のコラムに分かれている点が異なります。','Important: shows the article\'s featured image and title across all columns, but other content is shown in multiple columns.'=>'重要: 記事のアイキャッチ画像とタイトルはすべての列に表示されますが、他のコンテンツは複数の列に表示されます。','Parts start on a new page and include the part’s title, featured image, and content.'=>'パーツは新しいページから始まり、パーツのタイトル、アイキャッチ画像、およびコンテンツが含まれます。','Note that in order to improve page layout, all images and figures snap to the nearest page edge.'=>'ページレイアウトを改善するために、すべての画像と図が最も近いページの端にスナップすることに注意してください。','"Full width" images take up all columns and snap to the nearest page edge.'=>'「全幅」の画像はすべての列を占め、最も近いページの端にスナップします。','"Wide width" images take up 2 columns and snap to the nearest page edge.'=>'「ワイド幅」の画像は2列を占め、最も近いページの端にスナップします。','Only works with PMB’s Pro PDF Service.'=>'%1$sPro PDFサービスでより良く動作%2$s','%1$sAdd the CSS class "%2$s"%3$s to any images you don\'t want to snap like this.'=>'%1$sCSSクラス「%2$s」%3$sを、このようにスナップしたくない画像に追加します。','Issue %s, Page %s'=>'発行 %s、ページ %s','Issue %s'=>'問題 %s','Similar to Print My Blog Quick Print\'s other "Classic" designs, except optimized for reading by Microsoft Word. Useful when you need to deliver your content as a Microsoft Word Document (like to an editor), or for using as an intermediate format for delivery to other applications (like for importing into Adobe InDesign).'=>'Print My Blog Quick Printの他の「クラシック」デザインに似ていますが、Microsoft Wordによる読み取り用に最適化されている点が異なります。コンテンツを Microsoft Word ドキュメントとして配信する必要がある場合(エディターなど)、または他のアプリケーションへの配信の中間形式として使用する場合(Adobe InDesign への読み込みなど)に役立ちます。','A table of contents is generated and inserted at the requested location. Once in Microsoft Word, right click on the table of contents and click "Update Field"; or press Ctrl + A, then F9.'=>'目次が生成され、要求された場所に挿入されます。Microsoft Wordで、目次を右クリックして[フィールドの更新]をクリックします。をクリックするか、Ctrl + A キーを押してから F9 キーを押します。','Images may be bundled into the Word Document file so they can be used offline or if the website hosting the images goes offline.'=>'画像はオフラインで使用ため、ブックファイルにバンドルされています。','External hyperlinks (links to web pages not in the project) may be left as working hyperlinks or removed'=>'外部ハイパーリンク(プロジェクト内にないウェブページへのリンク)は、自動的に脚注に変換したり、削除したりできます','Internal hyperlinks (links to content included in the project) may be converted into links to the appropriate page of the document, left as hyperlinks to the website, or removed.'=>'内部ハイパーリンク(プロジェクトコンテンツへのリンク)は、自動的に脚注かインラインページ参照に変換したり、そのままにしたり、削除できます','All images are automatically included in the Word Document file (instead of merely pointing to the external image source). This makes the filesize larger, but allows users to view images while disconnected from the Internet.'=>'すべての画像は、(単に外部画像ソースを指すのではなく)Word文書ファイルに自動的に含まれます。これにより、ファイルサイズは大きくなりますが、ユーザーはインターネットから切断されているときに画像を表示できます。','Powered by Print My Blog Pro & WordPress'=>'Powered by Print My Blog Pro & WordPress','Purchase Required'=>'%1$s購入が必要%2$s','Works better with %1$sPro PDF Service%2$s'=>'%1$sPro PDFサービスでより良く動作%2$s','More Advanced Features in %1$sPro Print%2$s'=>'%1$sProプリントのより高度な機能%2$s','Drag the %s "%s" into your project'=>'%s「%s」をプロジェクトにドラッグします','View "%s"'=>'%sを表示','Edit "%s"'=>'“%s”を編集','Replace "%s" with the existing Print Material for customizing.'=>'"%s" を既存の印刷材料に置き換えて、カスタマイジングします。','Replace "%s" with a New Print Material for customizing'=>'「%s」をカスタマイジング用の新しい印刷物に置き換えます','Upgrade to Professional License for one-click copying to Print Materials for customization.'=>'プロフェッショナルライセンスにアップグレードして、ワンクリックで印刷物にコピーしてカスタマイズできます。','Add "%s" to project'=>'プロジェクトに「%s」を追加する','Remove "%s"'=>'「%s」を削除する','Drag or click here'=>'ドラッグまたはここをクリック','Post custom field name' . "\4" . '%s:'=>'%s:','We’re sorry, but you have another version of Print My Blog active. Only one can be active at a time. Please deactivate one.'=>'申し訳ありませんが、別のバージョンの [マイ ブログの印刷] がアクティブになっています。一度にアクティブにできるのは 1 つだけです。1 つを無効にしてください。','We’re sorry, but Print My Blog requires PHP version %1$s or greater in order to operate. You are currently running version %2$s.%3$sIn order to update your version of PHP, you will need to contact your current hosting provider.%3$sFor information on stable PHP versions, please go to %4$s.'=>'申し訳ありませんが、私のブログを印刷するにはPHPバージョン%1$s以上が必要です。現在、バージョン %2$s を実行しています。%3$sPHPのバージョンを更新するには、現在のホスティングプロバイダに連絡する必要があります。%3$sPHPの安定版については、%4$sをご覧ください。','We’re sorry, but Print My Blog requires WordPress %1$s. You are using %2$s.%3$sFor information on how to update, please see %4$s.'=>'申し訳ありませんが、私のブログを印刷するにはWordPressの%1$sが必要です。あなたは%2$sを使用しています。%3$s更新方法については、%4$sを参照してください。','360 Image Available'=>'360 個の画像が利用可能','Language'=>'言語','All Languages'=>'すべての言語','Default language (currently %s)'=>'既定の言語 (現在%s)','Translate %s Design'=>'翻訳%sデザイン','%s Translations'=>'%s翻訳','Translate Project Metadata'=>'プロジェクトメタデータの翻訳','"%1$s" is fully translated into %2$s'=>'"%s" は完全に %s に変換されます','Print My Blog'=>'私のブログを印刷する','Pro Print'=>'プロプリント','Print My Blog – Quick Print'=>'私のブログを印刷する - クイック印刷','Quick Print'=>'クイックプリント','Print My Blog Designs'=>'マイブログ設定を印刷する','Designs'=>'デザイン','Print My Blog Settings'=>'マイブログ設定を印刷する','Settings'=>'設定','Help Me Print My Blog'=>'私のブログを印刷するのを手伝ってください','Help'=>'ヘルプ','Keyboard Accessibility'=>'キーボードのアクセシビリティ','Settings Saved!'=>'設定を保存しました！','You should see the changes on your %1$slatest post%2$s.'=>'変更は%1$s最新の投稿%2$sに表示されます。','Show print buttons on:'=>'印刷ボタンの表示先:','Note: you need to upgrade your license to access the following formats: %s'=>'注: 次の形式にアクセスするには、ライセンスをアップグレードする必要があります。 %s','Print Formats'=>'印刷形式','Email Print My Blog Support'=>'メール印刷マイブログサポート','Email successfully sent. Expect a reply in the next 1-2 business days.'=>'電子メールが正常に送信されました。今後 1 ~ 2 営業日以内に返信が届くことを期待してください。','There was an error sending an email from your website (it was "%1$s"). Please manually send an email to %2$s, with the subject "%3$s", with the content:'=>'Web サイトからメールを送信中にエラーが発生しました ("%1$s" でした)。%2$sに「%3$s」という件名で、内容のメールを手動で送信してください：','Please explain what you did, what you expected, and what went wrong'=>'あなたが何をしたのか、何を期待していたのか、何がうまくいかなかったのかを説明してください','Including links to screenshots is appreciated'=>'スクリーンショットへのリンクを含めることは高く評価されています','Your Name'=>'名前','Are you ok with us viewing your most recent generated documents?'=>'最後に生成されたドキュメントを表示しても問題ありませんか?','Viewing your most recent generated documents saves a lot of time figuring out what is going wrong. We won’t share your content with anyone else.'=>'最後に生成されたドキュメントを表示すると、何が問題になっているのかを理解するのに多くの時間を節約できます。私たちはあなたのコンテンツを他の人と共有することはありません。','This debug info will also be sent.'=>'このデバッグ情報も送信されます。','This is mostly system information, list of active plugins, active theme, and some Print My Blog Pro info like your most recent projects.'=>'これは主にシステム情報、アクティブなプラグインのリスト、アクティブなテーマ、および最新のプロジェクトのようなPrint My Blog Pro情報です。','Support for your plan is offered on GitHub'=>'プランのサポートは GitHub で提供されます','GitHub is a public forum to share your issues with the developer and other users.'=>'GitHub は、開発者や他のユーザーと問題を共有するための公開フォーラムです。','You will need to first %1$screate a GitHub account%2$s. If you prefer to use email support please %3$spurchase a license that offers email support.%2$s'=>'最初に%1$sGitHub アカウントを作成%2$s必要があります。電子メールサポートを使用する場合は、%3$s電子メールサポートを提供するライセンスを購入してください。%2$s','Delete All Data'=>'すべてのデータを削除','Please select items to add to the project'=>'プロジェクトに追加する項目を選択してください','Please select items to remove'=>'削除する項目を選択してください','Please select items to move'=>'移動する項目を選択してください','Error inserting. Please use the PMB help page to get help'=>'挿入中にエラーが発生しました。PMBヘルプページを使用してヘルプを入手してください','Error creating new print material. Please use the PMB help page to get help.'=>'新しい印刷材料の作成中にエラーが発生しました。PMB ヘルプ ページを使用してヘルプを入手してください。','Your project\'s Body is empty. You may have forgetten to drag items from "Available Content" (on the left) into the "Chosen Project Content"\'s Body (on the right). Are you sure you want to leave your project\'s Body empty?'=>'プロジェクトの本文が空です。「利用可能なコンテンツ」(左側)から「選択したプロジェクトコンテンツ」の本文(右側)にアイテムをドラッグするのを忘れた可能性があります。プロジェクトの Body を空のままにしてもよろしいですか?','There was an error preparing your content. Please visit the Print My Blog Help page.'=>'コンテンツの準備中にエラーが発生しました。私のブログの印刷ヘルプページをご覧ください。','Your project could not be accessed in order to generate the file. Maybe your website is not public? Please visit the Print My Blog Help page.'=>'ファイルを生成するためにプロジェクトにアクセスできませんでした。たぶんあなたのウェブサイトは公開されていませんか?私のブログの印刷ヘルプページをご覧ください。','Are you sure you want to duplicate this project?'=>'このプロジェクトを複製してよろしいですか?','There was an error communicating with Print My Blog Central. It was %s'=>'Print My Blog Central との通信中にエラーが発生しました。それは%sだった','Design "%s" successfully saved.'=>'デザイン「%s」が正常に保存されました。','An invalid design (%1$s) or format provided(%2$s)'=>'無効なデザイン (%s) または指定された形式 (%s)','%1$s is now the default design the %2$s on all new projects.'=>'%1$s が、すべての新しいプロジェクトの既定のデザイン%2$sになりました。','Project Title'=>'タイトル','Format'=>'フォーマット','Successfully setup the project "%s".'=>'プロジェクト「%s」のセットアップに成功しました。','You need to choose and customize the design for your %s.'=>'あなたはあなたの%sのためにデザインを選択してカスタマイズする必要があります。','The content in your project has changed'=>'プロジェクトの内容が変更されました','Updated project content.'=>'プロジェクトの内容を更新しました。','You have customized this design'=>'このデザインをカスタマイズしました','The design "%s" has been customized, and its changes will be reflected in all projects that use it.'=>'デザイン「%s」はカスタマイズされており、その変更はそれを使用するすべてのプロジェクトに反映されます。','You changed the design'=>'デザインを変更した','You chose the design "%1$s" for the %2$s of your project.'=>'プロジェクトの%1$sに「%2$s」というデザインを選択しました。','You changed projected metadata'=>'投影されたメタデータを変更しました','Project metadata updated.'=>'プロジェクト メタデータが更新されました。','There is no file format with the slug "%s"'=>'スラッグ "%s" のファイル形式はありません。','Save'=>'保存','Project successfully duplicated. It is titled "%1$s".'=>'プロジェクトが正常に複製されました。タイトルは「%1$s」です。','Cached external resources and images were cleared.'=>'キャッシュされた外部リソースとイメージがクリアされました。','Go to the %1$s "%2$s" was copied from.'=>'「%1$s」のコピー元%2$sに移動します。','Go to Original %s'=>'元の%sに移動','Go to Print Material "%s" was created from.'=>'印刷物「%s」から作成されたものに移動します。','Go to Print Material'=>'印刷物に移動','Copy "%s" to New Print Material for a Print My Blog project'=>'「%s」を「マイブログ印刷」プロジェクトの新しい印刷物にコピーする','Copy to Print Material'=>'印刷物にコピー','Generate %s'=>'%sの生成','Nonce failure. Please refresh the page.'=>'ナンス失敗。ページを更新してください。','Show more...'=>'もっと見る...','No results. Try changing your search and filter criteria.'=>'結果はありません。検索条件とフィルター条件を変更してみてください。','Nonce failure'=>'Nonce 失敗','You do not have sufficient permissions to do this.'=>'これを行うための十分なアクセス許可がありません。','Unknown site name'=>'不明なサイト名','No categories available.'=>'使用可能なカテゴリはありません。','Invalid Post ID. The link you used to get here may be old. If it\'s new, please contact Print My Blog support.'=>'投稿 ID が無効です。ここにアクセスするために使用したリンクは古い可能性があります。新しい場合は、ブログの印刷サポートにお問い合わせください。','Unknown post type'=>'不明な投稿タイプ','There seems to be an error initializing. Please verify you are using an up-to-date web browser.'=>'初期化中にエラーが発生しているようです。最新のウェブブラウザを使用していることを確認してください。','Also check the WP REST API isn’t disabled by a security plugin. Feel free to contact Print My Blog support.'=>'また、WP REST APIがセキュリティプラグインによって無効になっていないことを確認してください。お気軽に私のブログの印刷サポートにお問い合わせください。','Loading Content'=>'コンテンツの読み込み','Loading Comments'=>'コメントの読み込み','Ordering Posts'=>'投稿の注文','Ordering Comments'=>'コメントの順序付け','Placing Content on Page'=>'ページへのコンテンツの配置','Optimizing for Print'=>'印刷の最適化','Print-Page Ready'=>'印刷ページ準備完了','There was an error fetching posts. It was: '=>'投稿の取得中にエラーが発生しました。そうでした：　','No response from WP REST API.'=>'WP REST API からの応答がありません。','Sorry, There was a Problem 😢'=>'申し訳ありませんが、問題😢がありました','%1$sRead our FAQs%2$s, then feel free to ask for help in %3$sthe support forum.%2$s'=>'%1$sFAQを%2$s読み、%3$sサポートフォーラムでお気軽にお問い合わせください。%2$s','Comments'=>'コメント','No Comments'=>'コメントなし','<span class="screen-reader-text says">says:</span>'=>'<span class="screen-reader-text says">曰く：</span>','ID:'=>'ID:','By'=>'投稿者','Protected:'=>'保護：','Private:'=>'プライベート：','Copied! Ready to paste.'=>'コピー！貼り付ける準備ができました。','There was an error copying. You can still select all the text manually and copy it.'=>'コピー中にエラーが発生しました。すべてのテキストを手動で選択してコピーすることもできます。','Title'=>'タイトル','Date'=>'日付','Delete'=>'削除','Untitled'=>'無題','Duplicate'=>'複製','Feature included in Professional and Business licenses'=>'プロフェッショナルおよびビジネスライセンスに含まれる機能','Started'=>'始めた','%1$s at %2$s'=>'%2$s の %1$s','Y/m/d'=>'Y年m月d日','g:i a'=>'g:i a','Click "Add New Project" 👆 To Make Your First Project!'=>'「新しいプロジェクトを追加」👆をクリックして、最初のプロジェクトを作成してください!','Classic Print PDf'=>'クラシックプリントPDf','Font Settings'=>'フォント設定','Paragraph Indent'=>'段落インデント','Indent the first line of each new paragraph instead of adding a paragraph break.'=>'段落区切りを追加する代わりに、新しい各段落の最初の行をインデントします。','Link, Page Reference, and Footnote Settings'=>'リンク、ページ参照、脚注の設定','Remove'=>'削除','Replace with page reference'=>'ページ参照で置換','Replace with footnote'=>'脚注で置き換える','Internal Hyperlinks'=>'内部ハイパーリンク','How to display hyperlinks to content included in this project.'=>'このプロジェクトに含まれるコンテンツへのハイパーリンクを表示する方法。','External Hyperlinks'=>'外部ハイパーリンク','How to display hyperlinks to content not included in this project.'=>'このプロジェクトに含まれていないコンテンツへのハイパーリンクを表示する方法。','Classic Digital PDF'=>'クラシックデジタルPDF','Buurma Digital PDF'=>'ブウルマデジタルPDF','Title Page Top-Banner Color'=>'タイトルページトップバナーカラー','Image used at the top of the background on the title page.'=>'タイトル ページの背景の上部で使用される画像。','Background Color'=>'背景色','A gradient between this color and white will be used in the page backgrounds'=>'この色と白の間のグラデーションがページの背景で使用されます','Organization Name'=>'寄付の宛先 (組織名)','Shown in the title page. Eg "Institute of Print My Blog"'=>'タイトル ページに表示されます。例えば、 "印刷研究所私のブログ"','Background Embellishment'=>'背景の装飾','Faded image used as a full-page background on the title page, and next to the page number on numbered pages.'=>'タイトル ページでは全ページの背景として、番号付きページではページ番号の横に使用されるフェード イメージ。','Issue'=>'問題','Text that appears at the top-right of the cover'=>'表紙の右上に表示されるテキスト','ByLine'=>'署名','Project Author(s)'=>'プロジェクト著者','Date Issued'=>'発行日','Text that appears under the byline'=>'バイラインの下に表示されるテキスト','Coverpage Preamble'=>'表紙前文','Explanatory text that appears at the bottom of the cover page'=>'表紙の下部に表示される説明テキスト','Mayer Digital PDF'=>'メイヤーデジタルPDF','Each Post Begins on a New Page'=>'各投稿は新しいページから始まります','Browser support for pagebreaks on columns is typically not very good.'=>'列の改ページに対するブラウザーのサポートは、通常、あまり良くありません。','Whether to force posts to always start on a new page. Doing so makes the page more legible, but uses more paper.'=>'投稿を常に新しいページで強制的に開始するかどうか。これにより、ページは読みやすくなりますが、より多くの用紙が使用されます。','Show Post Header inside Columns'=>'列内に投稿ヘッダーを表示','Check this to make post header information, like title, date, author, etc, appear inside columns; uncheck this to have it take up the full page width'=>'これをチェックして、タイトル、日付、著者などの投稿ヘッダー情報を列内に表示します。このチェックを外すと、ページ幅全体が占有されます','Show a Dividing Line Between Posts'=>'投稿間の分割線を表示する','Full-Column Images'=>'全列画像','Resizes images to be the full column width (except ones with the CSS class "mayer-no-resize")'=>'画像のサイズを列幅いっぱいに変更します(CSSクラス "mayer-no-resize"を持つ画像を除く)','Remove Extra Columns'=>'余分な列の削除','Forces your content to only use two columns, even if the content itself was divided into more columns (eg using the "Columns" block)'=>'コンテンツ自体がより多くの列に分割されている場合でも(たとえば、「列」ブロックを使用して)、コンテンツが2つの列のみを使用するように強制します。','Byline'=>'署名欄','Project author(s)'=>'プロジェクト著者','Classic ePub'=>'クラシックeパブ','Convert Videos to Images and Links'=>'ビデオを画像やリンクに変換する','Some eReaders don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'一部の電子書籍リーダーでは動画が表示されないため、画像とオンライン動画コンテンツへのハイパーリンクに置き換えることができます。','Title page and Part Header Font Size'=>'タイトルページと部品ヘッダーのフォントサイズ','Font size used for the default title page’s and part’s header (all other headers’ sizes are derived from the main font size). Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'既定のタイトル ページとパーツのヘッダーに使用されるフォント サイズ (他のすべてのヘッダーのサイズは、メインのフォント サイズから派生します)。認識された%1$sCSSフォントサイズキーワード%2$s(「大」、「中」、「小」など)または%3$s任意の単位の長さ%2$s(「14pt」、「50%%」、「10px」など)を使用します。','Custom Header Font'=>'標題字體','Default font to use for headers of articles, parts, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'記事や部品などのヘッダーに使用するデフォルトのフォント。拡張子が「ttf」のフォントファイルは、ほとんどの電子書籍リーダーで動作します。既定のフォントを使用するには、空白のままにします。','Font Size'=>'フォントサイズ','Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'認識された%1$sCSSフォントサイズキーワード%2$s(「大」、「中」、「小」など)または%3$s任意の単位の長さ%2$s(「14pt」、「50%%」、「10px」など)を使用します。','Custom Font'=>'カスタム フォント','Default font used in paragraphs, lists, tables, captions, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'段落、リスト、表、キャプションなどで使用されるデフォルトのフォント。拡張子が「ttf」のフォントファイルは、ほとんどの電子書籍リーダーで動作します。既定のフォントを使用するには、空白のままにします。','File name'=>'ファイル名','Description'=>'説明','Shown as eBook metadata.'=>'電子書籍メタデータとして表示されます。','Cover Image'=>'カバー画像','Cover image used on eBook file (does not necessarily appear inside project). Ideal dimensions are 2,560 x 1,600 pixels.'=>'電子書籍ファイルで使用される表紙画像(必ずしもプロジェクト内に表示されるとは限りません)。理想的な寸法は 2,560 x 1,600 ピクセルです。','Classic Word'=>'クラシックeパブ','Headers and Footers'=>'ヘッダとフッタ','Document Header on First Page'=>'最初のページのドキュメントヘッダー','Content to appear in top margin area but only on the first page.'=>'コンテンツは上部の余白領域に表示されますが、最初のページにのみ表示されます。','Document Header on Subsequent Pages'=>'後続のページのドキュメントヘッダー','Content to appear in top margin area on all pages except the first page.'=>'最初のページを除くすべてのページの上部余白領域に表示されるコンテンツ。','Document Footer'=>'ドキュメントフッター','Content to appear in bottom margin area.'=>'印刷する各投稿のコンテンツ。','Some Word Processors don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'一部の電子書籍リーダーでは動画が表示されないため、画像とオンライン動画コンテンツへのハイパーリンクに置き換えることができます。','Maximum Image Height (in pixels)'=>'最大画像の高さ(ピクセル単位)','Larger images will be resized to this, smaller images will be unchanged.'=>'大きい画像はこれにサイズ変更され、小さい画像は変更されません。','Leave as hyperlink to website'=>'ハイパーリンクとして残す','Leave as hyperlink to document'=>'ハイパーリンクとして残す','Leave as hyperlink'=>'ハイパーリンクとして残す','Haller Tabloid Print PDF'=>'クラシック印刷 PDF','Publication Logo Image'=>'出版前文','Logo image to show on the front page and in the header of subsequent pages. Leave blank to just use a "Title of Publication".'=>'フロントページと後続のページのヘッダーに表示するロゴ画像。「出版物のタイトル」のみを使用するには、空白のままにします。','Title of Publication'=>'出版物のタイトル','Shown in a large font on front page and in the top margin of every subsequent page.'=>'フロントページと後続のすべてのページの上余白に大きなフォントで表示されます。','Subtitle of Publication'=>'出版物のサブタイトル','Shown under the name of the publication, in a slightly smaller font.'=>'パブリケーション名の下に、少し小さいフォントで表示されます。','Publication Preamble'=>'出版前文','Shown on the front page under the Title and Subtitle.'=>'フロントページのタイトルとサブタイトルの下に表示されます。','Columns'=>'カラム','Number of columns to use for content.'=>'コンテンツに使用する列の数。','Shown on frontpage and in the top margin of all subsequent pages.'=>'フロントページと後続のすべてのページの上部余白に表示されます。','Issue Number'=>'交付番号','Shown on the frontpage and in the top margin of all subsequent pages (shortcodes supported).'=>'フロントページと後続のすべてのページの上余白に表示されます(ショートコードがサポートされています)。','Frontpage Title Left Call-Out'=>'フロントページタイトル左コールアウト','HTML displayed to the left of the title on the frontpage (shortcodes supported).'=>'フロントページのタイトルの左側に表示されるHTML(ショートコードがサポートされています)。','Frontpage Title Right Call-Out'=>'フロントページタイトル右コールアウト','HTML displayed to the right of the title on the frontpage'=>'フロントページのタイトルの右側に表示されるHTML','Subtitle'=>'サブタイトル','Source Location'=>'ソースの場所','Shown on the title page under the subtitle. Could be your website’s URL, or anything else you like.'=>'タイトルページの字幕の下に表示されます。あなたのウェブサイトのURLやあなたが好きな他のものかもしれません。','Site URL'=>'サイト URL','Date Printed'=>'印刷日','Title Page Content'=>'タイトルページのコンテンツ','Post Title'=>'投稿タイトル','ID'=>'ID','Author'=>'投稿者','Published Date'=>'公開日','Categories and Tags'=>'カテゴリとタグ','URL'=>'URL','Featured Image'=>'アイキャッチ画像','Excerpt'=>'抜粋','Custom Fields'=>'カスタムフィールド','Content'=>'コンテンツ','Post Content'=>'投稿のコンテンツ','Content from each post to print.'=>'印刷する各投稿のコンテンツ。','Image & Block Settings'=>'画像の設定','Page Settings'=>'ページ設定','Page Width'=>'ページ幅','Not supported by some browsers'=>'一部のブラウザではサポートされていません','Use standard %1$sCSS units%2$s'=>'標準の %1$sCSS 単位を使用%2$s','Page Height'=>'ページの高さ','Your theme, "%1$s", can be used in conjunction with your design. Themes are often not intended for print and can conflict with the design, but you may have content that looks broken without the theme.'=>'テーマ「%1$s」は、デザインと組み合わせて使用できます。テーマは印刷用ではないことが多く、デザインと競合する可能性がありますが、テーマがないとコンテンツが壊れているように見えることがあります。','Note: this option is only supported for the business license.'=>'注: このオプションは、ビジネス・ライセンスでのみサポートされます。','Don’t Change Image Quality'=>'画質を変更しない','%s pixels wide'=>'幅 %s ピクセル','Full Size (on web)'=>'フルサイズ(ウェブ上)','Uploaded Size (largest possible)'=>'アップロードされたサイズ(可能な限り大きい)','Image Quality (in pixels)'=>'画質 (ピクセル単位)','Lower quality means smaller file size, whereas higher quality means higher resolution images. Note: if images are missing from the generated PDF, the requested image size might not be available. Use the %1$s Regenerate Thumbnails plugin%2$s to create the missing image sizes.'=>'低品質はファイルサイズが小さいことを意味し、高品質は高解像度の画像を意味します。注記: 生成された PDF に画像がない場合は、要求された画像サイズが使用できない可能性があります。%1$sサムネイルの再生成プラグインを使用して%2$s不足している画像サイズを作成します。','Apply Website Theme'=>'ウェブサイトのテーマを適用する','Custom CSS'=>'カスタムCSS','Styles to be applied only when printing projects using this design.'=>'このデザインを使用してプロジェクトを印刷するときにのみ適用されるスタイル。','Add "Powered By"'=>'「電源」を追加','In compliance with WordPress.org guidelines, not added when printing from your browser.'=>'WordPress.org ガイドラインに準拠しており、ブラウザから印刷するときには追加されません。','Instructs the Pro PDF Service to add "Powered by Print My Blog Pro & WordPress" to your project. Does not appear when printing using your browser.'=>'Pro PDF Service に "Powered by Print My Blog Pro & WordPress" をプロジェクトに追加するよう指示します。ブラウザで印刷するときには表示されません。','Page Reference Text'=>'ページ参照テキスト','Text to use when replacing a hyperlink with a page reference. "%s" will be replaced with the page number.'=>'ハイパーリンクをページ参照で置き換えるときに使用するテキスト。「%s」はページ番号に置き換えられます。','(see page %s)'=>'(%sページ参照)','You must include "%s" in the page reference text so we know where to put the page number.'=>'ページ参照テキストに「%s」を含めると、ページ番号の配置場所がわかります。','Internal Footnote Text'=>'内部脚注テキスト','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the page number.'=>'ハイパーリンクを脚注に置き換えるときに使用するテキスト。「%s」はページ番号に置き換えられます。','See page %s.'=>'%sページを参照してください。','You must include "%s" in the footnote text so we know where to put the URL.'=>'脚注テキストに「%s」を含めると、URLをどこに置くべきかがわかります。','External Footnote Text'=>'外部脚注テキスト','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the URL'=>'ハイパーリンクを脚注に置き換えるときに使用するテキスト。「%s」はURLに置き換えられます','See %s.'=>'%sを参照してください。','None'=>'なし','Center'=>'中央','Default Image Alignment'=>'デフォルトの画像配置','Images normally default to "no alignment", which can look jumbled in printouts. Usually it’s best to automatically switch those to align to the center.'=>'画像は通常、デフォルトで「整列なし」で、印刷物でごちゃごちゃに見えることがあります。通常、中央に揃えるように自動的に切り替えるのが最善です。','Don’t move'=>'動かないで','Snap to the top or bottom of the page'=>'ページの上部または下部にスナップする','Only snap if it would otherwise cause a page break'=>'スナップは、改ページの原因になる場合のみに限ります','Resize images if they don’t fit on the page'=>'ページに収まらない場合の画像のサイズ変更','Image and Block Placement'=>'画像の配置','Image snapping and dynamic resizing only works using the Pro PDF Service.'=>'脚注とページ参照は、Pro PDF サービスでのみ機能します','To reduce whitespace around images, galleries, and tables, Print My Blog can adjust the placement of your content, or resize it according to the space on the page.'=>'画像、ギャラリー、および表の周囲の空白を減らすために、Print My Blog ではコンテンツの配置を調整したり、ページ上のスペースに応じてコンテンツのサイズを変更したりできます。','Minimum Image Size (in pixels)'=>'最小画像サイズ(ピクセル単位)','Any images larger than this may be resized to fit onto the page, but they will be no smaller than this size.'=>'これより大きい画像は、ページに収まるようにサイズ変更できますが、このサイズより小さくはなりません。','Add QR Code to Videos'=>'動画にQRコードを追加する','After a video is converted into a screenshot and URL, you can optionally add a QR code that readers can scan with their phones to view the video.'=>'ビデオをスクリーンショットとURLに変換した後、必要に応じて、読者が携帯電話でスキャンしてビデオを表示できるQRコードを追加できます。','Arial'=>'Arial','Courier New'=>'Courier New','Georgia'=>'ジョージア','Impact'=>'表示箇所','Lucida Console'=>'ルシーダコンソール','Palatino Linotype'=>'パラティーノ・リノタイプ','Tahoma'=>'Tahoma','Times New Roman'=>'Times New Roman','Verdana'=>'Verdana','Custom Font...'=>'カスタムフォント...','Header Font'=>'標題字體','Default font for header tags'=>'ヘッダータグのデフォルトフォント','Specify the URL of a custom font file, or upload one. The formats "wff" and "wff2" work best, but "ttf" and "otf" also work.'=>'カスタムフォントファイルのURLを指定するか、アップロードします。"wff" と "wff2" の形式が最適ですが、"ttf" と "otf" も機能します。','Font'=>'フォント','Default font used in paragraphs, bulleted lists, tables, etc.'=>'段落、箇条書きリスト、表などで使用される既定のフォント。','A simple but flexible design intended mainly for reading from screens, inspired by Print My Blog Quick Print.'=>'シンプルで柔軟なデザインは、主に画面からの読書を目的とし、印刷マイブログクイックプリントに触発されました。','Title page, with working hyperlinks.'=>'作業ハイパーリンクを含むタイトル ページ。','Main matter, showing hyperlinks and large images.'=>'ハイパーリンクと大きな画像を表示する主な問題。','Editorial Review'=>'エディトリアルレビュー','Your writing in an easy-to-review format for editors.'=>'編集者にとってレビューしやすい形式でのあなたの文章。','Title page, showing the double-spaced text.'=>'タイトル ページ。ダブル スペースのテキストが表示されます。','Main matter, showing smaller images and double-spaced text.'=>'主な問題は、小さな画像とダブルスペースのテキストを表示することです。','Classic Print PDF'=>'クラシック印刷 PDF','A simple but flexible design intended for printing, inspired by Print My Blog Quick Print'=>'印刷を目的としたシンプルだが柔軟なデザイン、印刷マイブログクイックプリントに触発された','Title page, showing removed hyperlinks.'=>'削除されたハイパーリンクを表示するタイトル ページ。','Main matter, showing external hyperlinks automatically converted into footnotes. Page numbers are always on the bottom-outside corner, and each article’s title is shown at the top of right pages.'=>'主な事項は、脚注に自動的に変換された外部ハイパーリンクを表示することです。ページ番号は常に外側の下隅にあり、各記事のタイトルは右ページの上部に表示されます。','Economical Print PDF'=>'経済的な印刷PDF','Compact design meant to save paper but still deliver all the content.'=>'コンパクトなデザインは、紙を節約しながらもすべてのコンテンツを提供することを意味していました。','Title page, showing smaller text.'=>'小さいテキストを表示するタイトル ページ。','Main matter, showing smaller text and images to reduce ink usage.'=>'主な問題は、インク使用量を減らすために小さなテキストと画像を表示することです。','Buurma Whitepaper'=>'ブウルマホワイトペーパー','Stylized and branded PDF designed mainly for reading from a device, great for organizations'=>'主にデバイスからの読み取り用に設計された定型化されたブランド化されたPDFで、組織に最適です','Title page, showing a stylzed upper margin for a company name, background gradient and logo, among other things.'=>'タイトル ページ。会社名、背景のグラデーション、ロゴなどのスタイル化された上余白が表示されます。','Main matter, showing working hyperlinks (which also each get an automatic footnote), and page number and logo in bottom-right corner.'=>'主な事項は、作業中のハイパーリンク(それぞれに自動脚注が表示されます)、および右下隅にページ番号とロゴを表示することです。','Issue 01'=>'第01号','Text explaining the purpose of the paper and gives a brief summary of it, so folks know they’re reading the right thing.'=>'テキストは、論文の目的を説明し、それの簡単な要約を与えるので、人々は彼らが正しいものを読んでいることを知っている。','Mayer Magazine'=>'メイヤーマガジン','Digital 2-column magazine inspired by the defunct Zinepal'=>'廃刊となったジネパルにインスパイアされたデジタル2列マガジン','Title page and table of contents both fit on the first page.'=>'タイトルページと目次はどちらも最初のページに収まります。','Two column layout which compactly shows content and images.'=>'コンテンツと画像をコンパクトに表示する2列レイアウト。','Simple ePub for using when uploading as an eBook to Amazon and other epub marketplaces'=>'Amazonや他のepubマーケットプレイスに電子書籍としてアップロードするときに使用するシンプルなePub','Simple Microsoft Word document when that format is required.'=>'その形式が必要な場合のシンプルなマイクロソフトワード文書。','Title page and table of contents.'=>'タイトルページと目次はどちらも最初のページに収まります。','Simple layout'=>'シンプルなレイアウト','Haller Tabloid'=>'ハラータブロイド紙','Print-ready newspaper design'=>'印刷可能な新聞デザイン','Digital PDF'=>'デジタルPDF','PDF file intended for viewing on a computer, tablet or phone, but not necessarily for printing to paper. Usually includes working hyperlinks, ample colors, and other features that require a device.'=>'PDFファイルは、コンピュータ、タブレット、または携帯電話での表示を目的としていますが、必ずしも紙に印刷するためのものではありません。通常、機能するハイパーリンク、十分な色、およびデバイスを必要とするその他の機能が含まれます。','Print-Ready PDF'=>'印刷可能な PDF','PDF file intended for printing on your home printer or with a printer service. Usually removes hyperlinks, avoids excessive ink use, and are designed for viewing the 2-page spread (using the front and back of a page).'=>'自宅のプリンターまたはプリンター サービスで印刷するための PDF ファイル。通常、ハイパーリンクを削除し、インクの過度の使用を回避し、見開き 2 ページを表示するために設計されています (ページの表と裏を使用)。','eBook (ePub)'=>'電子ブック(電子パブ)','ePub file intended for reading from an eReader, tablet, or phone; or for publishing on an eBook marketplace like Amazon\'s Kindle Direct Publishing, Apple Books, or Kobo.'=>'電子書籍リーダー、タブレット、または電話からの読み取りを目的としたePubファイル。または、AmazonのKindle Direct Publishing、Apple Books、Koboなどの電子書籍市場での出版用です。','Create unlimited ePubs with any purchase.'=>'任意の購入で無制限のeパブを作成します。','Word Document'=>'Word Document','File editable in Microsoft Word, Google Docs, and LibreOffice (not Apple\'s Pages app, unfortunately). Useful for sharing persons and programs that require a ".doc" file. Word Documents typically require manual formatting in your chosen Word Processor.'=>'Microsoft Word、Google Docs、LibreOfficeなどで編集可能なファイル。「.doc」ファイルを必要とする人やプログラムを共有するのに便利です。Word文書は通常、選択したワードプロセッサで手動でフォーマットする必要があります。','Create unlimited Word Documents with a Pro Plan.'=>'任意の購入で無制限のeパブを作成します。','About Quick Print'=>'クイックプリントについて','This is the quick-and-easy option, best for making printouts for your own records. For something more professional and full-featured, use %1$sPro Print%2$s. It has free and paid options. %3$sSee full feature comparison.%2$s'=>'これはすばやく簡単なオプションであり、自分のレコードのプリントアウトを作成するのに最適です。よりプロフェッショナルでフル機能のものについては、%1$sPro Print%2$sを使用してください。無料と有料のオプションがあります。%3$s完全な機能の比較を参照してください。%2$s','About Pro Print'=>'プロプリントについて','Pro Print is the best way to make professional-quality documents. You will be able to print them for free using your browser, or upgrade to use Print My Blog Pro\'s full features. %1$sSee full feature comparison.%2$s'=>'プロプリントは、プロ品質の文書を作成するための最良の方法です。ブラウザを使用して無料で印刷したり、Print My Blog Proの全機能を使用するようにアップグレードしたりできます。%1$s完全な機能の比較を参照してください。%2$s','If you just want something quick, use %1$sQuick Print%2$s instead.'=>'何か手っ取り早くしたいだけなら、代わりに%1$sクイックプリント%2$sを使用してください。','Project Designs are like WordPress Themes'=>'プロジェクトデザインはワードプレスのテーマのようなものです','Each has a different look and options that can be customized.'=>'それぞれに異なる外観とカスタマイズ可能なオプションがあります。','The "Classic" design is the most similar Print My Blog’s Quick Print, so it’s a good default choice.'=>'「クラシック」デザインは、私のブログのクイックプリントを印刷するのに最も似ているので、デフォルトの選択として適しています。','Click on the preview image for more details, and feel free to come back to this page later if you want to try a different design.'=>'詳細については、プレビュー画像をクリックし、別のデザインを試したい場合は、後でこのページに戻ってください。','Read the User Guide'=>'ユーザーガイドを読む','Each Design has Different Options and is Reusable'=>'各デザインには異なるオプションがあり、再利用可能','Below are your chosen design’s customization options.'=>'以下は、選択したデザインのカスタマイズオプションです。','If you don’t see an option you need, you may want to go back and choose a different design, or ask the design’s author for it.'=>'必要なオプションが表示されない場合は、戻って別のデザインを選択するか、デザインの作者に依頼してください。','Note: designs are reused between projects. So customizations to this design will be reused by other projects using this same design'=>'注: デザインはプロジェクト間で再利用されます。したがって、このデザインのカスタマイズは、この同じデザインを使用する他のプロジェクトによって再利用されます','How to Edit Project Content'=>'プロジェクトコンテンツを編集する方法','Find the articles (posts, pages, other post types) from WordPress you want to add on the left, and add it to your project on the right by dragging'=>'左側に追加したいWordPressの記事(投稿、ページ、その他の投稿タイプ)を見つけ、右側のプロジェクトにドラッグして追加します','Title Page and Table of Contents print materials are automatically added to each project, but you can remove or %1$scustomize them%2$s.'=>'タイトルページと目次 印刷資料は各プロジェクトに自動的に追加されますが、削除または%1$sカスタマイズ%2$sできます。','Place articles in either front matter, body, or back matter, according to how you want your project organized. Each design can style them differently (eg front matter is often is numbered with roman numerals)'=>'記事をフロントマター、メインマター、またはバックマターのいずれかに配置して、プロジェクトをどのように編成するかに応じて配置します。各デザインはそれらを異なるスタイルにすることができます(例えば、フロントマターはしばしばローマ数字で番号が付けられています)','Nest content inside others to create parts'=>'コンテンツを他のコンテンツの内部にネストしてパーツを作成する','Read the User Guide on how to edit your project\'s content.'=>'プロジェクトのコンテンツを編集する方法については、ユーザーガイドをお読みください。','Everything Else About Your Project is Stored Here'=>'プロジェクトに関するその他のすべてはここに保存されます','Different formats and designs may require other information about your project.'=>'形式やデザインが異なると、プロジェクトに関する他の情報が必要になる場合があります。','Some examples of metadata are: title page info, file info, or copyright data.'=>'メタデータの例としては、タイトル ページ情報、ファイル情報、著作権データなどがあります。','So although your choice of design may affect what metadata is required, it is not shared with other projects.'=>'そのため、デザインの選択は必要なメタデータに影響する可能性がありますが、他のプロジェクトとは共有されません。','Generate and View Your File'=>'ファイルの生成と表示','Your project is ready to be generated! Clicking "Generate" will compile your content into a print-page.'=>'プロジェクトを生成する準備ができました!「生成」をクリックすると、コンテンツが印刷ページにコンパイルされます。','Read the User Guide on %1$supdating%2$s, %3$sgenerating the pro file%2$s, and %4$sgetting help%2$s.'=>'%1$s更新%2$s、%3$sproファイルの生成%2$s、および%4$sヘルプの入手%2$sに関するユーザーガイドをお読みください。','Posts just for Print My Blog'=>'私のブログを印刷するためだけに投稿','Print My Blog "Print Materials" are like private posts. They aren’t visible to site visitors, but you can use them in your Pro Print Projects.'=>'私のブログを印刷する 「印刷物」はプライベートな投稿のようなものです。サイト訪問者には表示されませんが、Pro Print プロジェクトで使用できます。','Title Page'=>'標題紙','Table of Contents'=>'目次','Single Column'=>'シングルカラム','Fullpage Content'=>'フルページコンテンツ','Centered Content'=>'中央揃えのコンテンツ','Full Column Content'=>'フルページコンテンツ','Important'=>'重要','Print'=>'印刷','Print 🖨'=>'印刷する 🖨','PDF'=>'PDF','PDF 📄'=>'ティッカー 📄','eBook'=>'電子書籍','eBook 📱'=>'電子ブック 📱','Invalid format "%s".'=>'無効な形式 "%s"。','Site Title'=>'サイトタイトル','Tagline'=>'タグライン','Filters Used'=>'使用されるフィルター','E.g. selected categories, taxonomies, and date range.'=>'たとえば、選択したカテゴリ、分類、日付範囲などです。','Credit Print My Blog Plugin'=>'クレジット印刷マイブログプラグイン','Show some love and tell your readers about Print My Blog %1$s'=>'いくつかの愛を示し、印刷マイブログ%1$sについてあなたの読者に伝える','Extra dividing line at end of post'=>'投稿の最後に余分な分割線','1'=>'1','2'=>'2','3'=>'3','The number of columns of text on each page. Not supported by some web browsers.'=>'各ページのテキストの列数。一部の Web ブラウザーではサポートされていません。','Pro Print lets you specify header and text size and font'=>'Pro Printでは、ヘッダーとテキストのサイズとフォントを指定できます','Tiny (1/2 size)'=>'タイニー(1/2サイズ)','Small (3/4 size)'=>'小型(3/4サイズ)','Normal (theme default)'=>'標準 (テーマの既定値)','Large (slightly larger than normal)'=>'大きい(通常より少し大きい)','Image Size'=>'画像サイズ','Full (theme default)'=>'フル (テーマの既定値)','Large (3/4 size)'=>'ラージ(3/4サイズ)','Medium (1/2 size)'=>'ミディアム(1/2サイズ)','Small (1/4 size)'=>'小型(1/4サイズ)','None (hide images)'=>'なし (画像を非表示にする)','If you want to save paper, choose a smaller image size, or hide images altogether.'=>'用紙を節約する場合は、小さい画像サイズを選択するか、画像を完全に非表示にします。','Include Hyperlinks'=>'ハイパーリンクを含める','Pro Print with Pro PDF Service supports changing hyperlinks to page references or footnotes'=>'Pro PDFサービスでPro Printは、ページ参照または脚注へのハイパーリンクの変更をサポートしています','Include'=>'含める','Replace with URL in Parenthesis'=>'括弧内のURLに置き換える','Note: PDFs generated in Firefox and Safari automatically remove hyperlinks. If you want your PDF to include hyperlinks, please use another browser.'=>'注記: Firefox および Safari で生成された PDF はハイパーリンクを自動的に削除します。PDFにハイパーリンクを含める場合は、別のブラウザを使用してください。','Post Rendering Wait-Time'=>'レンダリング後の待機時間','ms'=>'ミリ秒','Milliseconds to wait between rendering posts. If posts are rendered too quickly on the page, sometimes images won’t load properly. '=>'投稿のレンダリング間で待機するミリ秒数。投稿がページ上でレンダリングされるのが速すぎると、画像が正しく読み込まれないことがあります','Include Inline Javascript'=>'インラインジャバスクリプトを含める','Sometimes posts contain inline javascript which can cause errors and stop the page from rendering.'=>'時々投稿にはインラインjavascriptが含まれており、エラーが発生し、ページのレンダリングが停止する可能性があります。','Include Unrendered Shortcodes'=>'レンダリングされていないショートコードを含める','If you left shortcodes from deactivated deactivated plugins or themes in your posts, they are automatically removed from printouts. Check this to leave them.'=>'非アクティブ化された非アクティブ化されたプラグインやテーマのショートコードを投稿に残した場合、それらは印刷物から自動的に削除されます。これをチェックして、それらを残してください。','article'=>'記事','part'=>'部分','volume'=>'volume','anthology'=>'アンソロジー','No generator class specified for format "%s"'=>'形式 "%s" にジェネレータークラスが指定されていません','Setup'=>'セットアップ','Choose %s Design'=>'デザイン%s選択','Customize %s Design'=>'%sデザインのカスタマイズ','Edit Content'=>'コンテンツを編集','Edit Metadata'=>'メタデータの編集','Generate Print Page'=>'印刷ページの生成','The design with slug "%s" should exist but doesn\'t. Check the plugin that added that design is still active (and if it required a subscription, that the subscription is still up-to-date). For now, please choose a different design.'=>'ナメクジ "%s"を持つデザインは存在するはずですが、存在しません。そのデザインがまだアクティブである(そしてサブスクリプションが必要な場合は、サブスクリプションがまだ最新であること)を追加したプラグインを確認してください。とりあえず、別のデザインを選んでください。','Template file "%s" should exist but doesn\'t.'=>'テンプレートファイル "%s" は存在するはずですが、存在しないはずです。','Default Template'=>'デフォルトテンプレート','No license ID available'=>'使用可能なライセンス ID がありません','There is no site registered with Freemius'=>'Freemiusに登録されているサイトはありません','Your project is very big and you might have errors downloading the file. If so, try splitting your content into multiple projects and instead creating multiple smaller files.'=>'プロジェクトが非常に大きく、ファイルのダウンロード中にエラーが発生することがあります。その場合は、コンテンツを複数のプロジェクトに分割し、代わりに複数の小さなファイルを作成してみてください。','Your project has lots of images and you might have errors downloading the file. If so, try spltting your content into multiple projects or reducing the image quality set on your design.'=>'プロジェクトに多くの画像があり、ファイルのダウンロード中にエラーが発生することがあります。その場合は、コンテンツを複数のプロジェクトに分割するか、デザインに設定されている画質を下げてみてください。','Downloading the Paid PDF will use one of your %1$s remaining credits, and is non-refundable.'=>'有料PDFをダウンロードすると、残りのクレジットの%1$s1つが使用され、払い戻しはできません。','Table of content - In Microsoft Word, please right-click and choose "Update field".'=>'目次 - Microsoft Wordでは、右クリックして[フィールドの更新]を選択してください。','Projects'=>'プロジェクト','Projects for printing with Print My Blog'=>'ブログ印刷で印刷するプロジェクト','Designs for printing with Print My Blog'=>'マイブログを印刷して印刷するためのデザイン','Post type general name' . "\4" . 'Print Materials'=>'印刷物','Post type singular name' . "\4" . 'Print Material'=>'印刷物','Admin Menu text' . "\4" . 'Print Materials'=>'印刷物','Add New on Toolbar' . "\4" . 'Print Material'=>'印刷物','Add New'=>'新規追加','Add New Print Material'=>'新しい印刷物の追加','New Print Material'=>'新しい印刷材料','Edit Print Material'=>'印刷物の編集','View Print Material'=>'印刷物を見る','All Print Materials'=>'すべての印刷物','Search Print Materials'=>'印刷物の検索','Parent Print Materials:'=>'親印刷物:','No Print Materials found.'=>'印刷物が見つかりません。','No Print Materials found in Trash.'=>'ゴミ箱に印刷物が見つかりません。','Overrides the “Featured Image” phrase for this post type. Added in 4.3' . "\4" . 'Print Material Cover I