$sを使用して印刷','Sorry, we could not print the WordPress Blog.'=>'申し訳ありませんが、ワードプレスのブログを印刷できませんでした。','Problem: %s'=>'問題: %s','Code: %s'=>'コード: %s','The site URL you provided was "%1$s". Are you sure that URL is correct and that it\'s a WordPress site?'=>'入力したサイトの URL は "%1$s" でした。URLが正しく、WordPressサイトであると確信していますか?','Are you sure the blog hasn\'t deactivated the REST API?'=>'ブログが REST API を無効にしていないことを確認していますか?','If you are still having problems, please report it to the %1$sPrint My Blog%2$s support forum.'=>'それでも問題が解決しない場合は、%1$sブログの印刷%2$sサポートフォーラムに報告してください。','Choose Design: %s'=>'デザインを選択: %s','<span>Active:</span> %s'=>'<span>能動：</span> %s','Use This Design'=>'このデザインを使用する','Use the Design "%s"'=>'デザイン "%s" を使用する','Use and Customize the Design "%s"'=>'デザイン「%s」を使用してカスタマイズする','Customize %s Design: %s'=>'カスタマイズ%sデザイン:%s','Edit Project Content'=>'プロジェクトコンテンツの編集','Available Content'=>'利用可能なコンテンツ','Select content from your website, then move it into your project. %1$sRead more%2$s.'=>'Web サイトからコンテンツを選択し、プロジェクトに移動します。%1$s続きを読む%2$s.','Use <em>CTRL</em> or <em>SHIFT</em> to select multiple items'=>'<em>Ctrl</em> キーまたは <em>Shift</em> キーを使用して複数の項目を選択する','Search Posts, Pages, Custom Post Types...'=>'検索投稿、ページ、カスタム投稿タイプ...','Show Filters'=>'フィルターを表示','Hide Filters'=>'フィルターを隠す','Post Type'=>'投稿タイプ','Any'=>'任意','Status'=>'ステータス','Draft'=>'下書き','Pending Review'=>'保留中のレビュー','Private'=>'プライベート','Published'=>'公開済み','Scheduled'=>'予定済み','Trash'=>'ゴミ箱','Written Between'=>'間に書かれている','%s and %s'=>'%s は%s でした','Show Included Content?'=>'含まれるコンテンツを表示しますか?','Show content already added to project'=>'プロジェクトに既に追加されているコンテンツを表示する','Order By'=>'並び順','Menu Order'=>'メニューの並び順','Search Relevance'=>'検索の関連性','Post ID'=>'投稿 ID','Ascending'=>'昇順','Descending'=>'降順','Search & Apply Filters'=>'検索とフィルターの適用','Select All'=>'すべて選択','Deselect All'=>'すべての選択を解除','Add selected items to project'=>'選択した項目をプロジェクトに追加する','Remove selected items'=>'選択したアイテムを削除する','Move selected items up'=>'選択したアイテムを上に移動する','Move selected items down'