その他のデバイスからの読み取りを目的としたPDFファイルを、ブラウザまたはブラウザの拡張機能を使用して作成します。','eBook (ePub or MOBI)'=>'電子書籍(電子パブまたはMOBI)','Make a free eBook using dotEPUB.'=>'dotEPUBを使用して無料の電子ブックを作成します','HTML'=>'HTML','Easily copy-and-paste into another program like Microsoft Word or Google Docs. Note: this is not recommended for customizing printouts, as other programs usually format the content poorly. Instead, use Print My Blog’s CSS classes to remove or add content from printouts.'=>'Microsoft WordやGoogle Docsなどの別のプログラムに簡単にコピー&ペーストできます。注: これは、他のプログラムは通常、コンテンツのフォーマットが不適切であるため、プリントアウトのカスタマイズには推奨されません。代わりに、印刷ブログの CSS クラスを使用して、印刷物からコンテンツを削除または追加します。','Learn More'=>'詳細はこちら','Show More Print Options'=>'その他の印刷オプションを表示','Options'=>'オプション','Post Selection'=>'投稿選択','Pro Print supports custom post types, combining posts with pages, and print-only materials'=>'Pro Printは、カスタム投稿タイプ、投稿とページの組み合わせ、印刷専用素材をサポートしています','Order'=>'注文','Pro Print supports drag-and-drop ordering of content.'=>'Pro Printは、コンテンツのドラッグアンドドロップ順序をサポートしています。','Posts will be ordered:'=>'投稿は注文されます:','Oldest First'=>'古い順','Newest First'=>'新しい順','Pages will be ordered using the "Order" attribute:'=>'ページは "Order" 属性を使用して順序付けられます','From Lowest to Highest'=>'最低から最高へ','From Highest to Lowest'=>'最高から最低へ','Password-Protected'=>'パスワードで保護','Statuses'=>'ステータス','Filters'=>'フィルター','Pro Print supports filtering by custom taxonomies.'=>'Pro Print では、カスタム分類によるフィルター処理がサポートされています。','Authored By'=>'著者','Posted After (and Including)'=>'投稿後(および含む)','Posted Before (and Including)'=>'投稿前 (および含む)','Prepare Print-Page'=>'印刷ページの準備','It’s finally here...'=>'それはついにここにあります...','Print My Blog – Pro Print!'=>'私のブログを印刷 - プロプリント!','The old features are still here: "Print Now" was just renamed "Quick Print", and the Print Buttons are still available under "Settings".'=>'古い機能はまだここにあります:「今すぐ印刷」は「クイックプリント」と改名されたばかりで、印刷ボタンは「設定」の下でまだ利用可能です。','Pro Print makes more functional and visually-appealing PDFs using your web browser for free, or the new paid Pro PDF Service.'=>'Pro Printは、Webブラウザを無料で、または新しい有料のPro PDFサービスを使用して、より機能的で視覚的に魅力的なPDFを作成します。','Automatic Table of Contents'=>'自動目次','Add a table of contents to your project, with links and page numbers.'=>'リンクとページ番号を含む目次をプロジェクトに追加します。','Pro PDF Service adds page numbers.'=>'プロPDFサービスは、ページ番号を追加します。','Automatic page references and footnotes'=>'自動ページ参照と脚注','Hyperlinks can be automatically converted into references to the page the linked-to content is located, or a footnote with the web address print-out.'=>'ハイパーリンクは、リンク先のコンテンツが配置されているページへの参照、または Web アドレスが印刷された脚注に自動的に変換できます。','Proper margins, page numbers and running heads'=>'適切な余白、ページ番号、ランニングヘッド','Clean margins, alternating page numbers, roman numerals for front matter, running chapter heads, and more.'=>'きれいな余白、交互のページ番号、フロントマターのローマ数字、チャプターヘッドの実行など。','Support Custom Post Types'=>'カスタム投稿タイプをサポート','Content from other plugins, like WooCommerce Products, or your LMS\'s course materials, can be included in projects.'=>'WooCommerce 製品や LMS のコース教材などの他のプラグインのコンテンツをプロジェクトに含めることができます。','Drag-and-Drop Content Organizer'=>'ドラッグアンドドロップコンテンツオーガナイザー','Drop posts, pages, and other post types into projects in any order. Even organize them into parts.'=>'投稿、ページ、その他の投稿タイプを任意の順序でプロジェクトにドロップします。それらを部分に整理することさえできます。','Premade, Reusable, Customizable Designs'=>'既製、再利用可能、カスタマイズ可能なデザイン','Print My Blog\'s Designs are like WordPress Themes: each has its own look and customization options. Reuse the same design across projects. Or even create your own design using HTML, CSS, and Javascript'=>'印刷マイブログのデザインはWordPressのテーマのようなものです:それぞれに独自の外観とカスタマイズオプションがあります。プロジェクト間で同じデザインを再利用します。または、HTML、CSS、および JavaScript を使用して独自のデザインを作成することもできます','Pro PDF Service lets designs fully control the margins, page backgrounds, and los of other aspects.'=>'Pro PDFサービスを使用すると、デザインは他の側面の余白、ページの背景、およびロスを完全に制御できます。','Saveable Projects'=>'保存可能なプロジェクト','Save where you left off.'=>'中断したところから保存します。','Front matter, back matter, parts, and print materials'=>'表裏、裏面、部品、印刷物','Add front and back matter to books, organize the content into parts, and add special "print material" posts to use only in your projects'=>'表と裏の事項を書籍に追加し、コンテンツをパーツに整理し、プロジェクトでのみ使用する特別な「印刷物」投稿を追加します','Features Include:'=>'含まれる機能:','Try Pro Print Now'=>'今すぐプロプリントをお試しください','Learn More on printmy.blog'=>'printmy.blog の詳細','Please %1$slet me know%2$s if you have any questions!'=>'ご不明な点がございましたら%1$s私に知らせてください%2$s!','Best wishes, Mike Nelson, Print My Blog Developer'=>'ベストウィッシュ、マイクネルソン、印刷私のブログ開発者','Welcome to %s!'=>'%s へようこそ！','Print My Blog Pro'=>'印刷私のブログプロ','What would you like to do?'=>'何を行いたいですか？','Print My Blog Now for Free'=>'今すぐ無料で私のブログを印刷','Use Quick Print'=>'クイックプリントを使用','2 clicks to printing'=>'2クリックで印刷','No watermark'=>'透かしなし','Print Thousands of Pages from your Web Browser'=>'Webブラウザから何千ものページを印刷する','Let Visitors Print My Blog for Free'=>'訪問者が無料で私のブログを印刷できるようにする','Configure the Print Button Settings'=>'印刷ボタンの設定を構成する','No Coding Required'=>'コーディング不要','Highly Customizable'=>'高度にカスタマイズ可能','Place Print Buttons Anywhere'=>'印刷ボタンをどこにでも配置','Make Professional Books and Documents'=>'プロフェッショナルな書籍やドキュメントを作成する','Use Pro Print'=>'プロプリントを使用','Free and Paid Options'=>'無料と有料のオプション','Drag-and-drop content into projects'=>'コンテンツをプロジェクトにドラッグアンドドロップする','Include any post types, in any order'=>'投稿タイプを任意の順序で含める','Choose and Customize Many Designs, or code your own'=>'多くのデザインを選択してカスタマイズするか、独自のコーディングを行う','Automatically convert hyperlinks to page references and footnotes'=>'ハイパーリンクをページ参照と脚注に自動的に変換する','https://printmy.blog'=>'https://printmy.blog','Make printing your blog easy and impressive. For you & your visitors. One post or thousands.'=>'あなたのブログを簡単かつ印象的に印刷してください。あなたとあなたの訪問者のために。1つの投稿または数千。','Michael Nelson'=>'マイケル・ネルソン']];
